import React from "react";

function Category() {
  return (
    <div className="category">
      <div className="container">
        <div className="row">
          <div className="col-lg-4"></div>
          <div className="col-lg-4"></div>
          <div className="col-lg-4"></div>
        </div>
      </div>
    </div>
  );
}

export default Category;
